// App.js
import './App.css';
import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Protected from './component/Routes/ProtectedHome';
import { CSSTransition } from 'react-transition-group';
import Home from './pages/Home';
import Progress from './pages/Progress';
import Explore from './pages/Explore'; // Corrected typo: Exeplore to Explore
import Profile from './pages/Profile';
import Messages from './pages/Messages'; // Corrected typo: Messeges to Messages
import Register from '../pages/Register';
import LoginPage from '../pages/Login';

function App() {
  const theme = createTheme({
    palette: {
      primary: {
        main: '#FFFFFF',
      },
      secondary: {
        main: '#0000FF',
      },
    },
  });

  return (
    <ThemeProvider theme={theme}>
      <BrowserRouter>
        <div className="App">
          <CSSTransition
            in={true}
            appear={true}
            timeout={300}
            classNames="page"
            unmountOnExit
          >
            <Routes>
              <Route path="/home" element={<Protected><Home /></Protected>} />
              <Route path="/prof" element={<Protected><Profile /></Protected>} />
              <Route path="/prog" element={<Protected><Progress /></Protected>} />
              <Route path="/exp" element={<Protected><Explore /></Protected>} />
              <Route path="/messages" element={<Protected><Messages /></Protected >} />
              <Route path="/register" element={<Register />} />
              <Route path="/" element={<LoginPage />} />
            </Routes>
          </CSSTransition>
        </div>
      </BrowserRouter>
    </ThemeProvider>
  );
}

export default App;
